import { Component, OnInit } from '@angular/core';
import { ApiService } from '../RideApi.service';
import { FormBuilder, FormControl, FormGroup, Validators } from '@angular/forms';
import { TokenService } from 'src/app/app.tokenservice';
import { FareDTO } from '../Models/model.faredto';

@Component({
  selector: 'app-schedule-ride',
  templateUrl: './schedule-ride.component.html',
  styleUrls: ['./schedule-ride.component.scss']
})
export class ScheduleRideComponent implements OnInit{

  distances:any[] = [];
  isLoading:boolean=false;
  newride: FormGroup ;
  submitted:boolean=false;
  fdto:FareDTO;
  Fare:any;


  constructor(private formBuilder: FormBuilder,private apiService:ApiService,private tokenService:TokenService){}

  ngOnInit(): void {
    this.isLoading=true;
{
    this.apiService.getdistances().subscribe((response: any[]) => {


      this.distances = response;

      //console.log(this.tokenService.getToken());

    });

    this.newride= new FormGroup({
      rideFrom :new FormControl('',Validators.required),
      rideTo:new FormControl('',Validators.required),
      rideStartsOn:new FormControl(new Date(),Validators.required),
      rideTime:new FormControl(Validators.required),
      vehicleRegistrationNo:new FormControl('',Validators.required),
      motoristUserId:new FormControl(this.tokenService.getid(),Validators.required),
      noOfSeatsAvailable:new FormControl(Validators.required)



    });
    }
    this.isLoading=false;
  }

  onOptionSelected(event:any){
    const distanceId: string = event.target.value;
     var r;
    this.apiService.getregno(this.tokenService.getid()).subscribe((response:string) =>{
      r = response
    })

    this.fdto=new FareDTO(r,distanceId);
    this.Fare = this.apiService.getfare(this.fdto);

  }

  onSubmit() {}



}
